bool SceneGraph::AddChild(SceneNode* child, SceneNode* parent) {
    if (child != NULL) {
        if (parent != NULL) {
            child->parent = parent;
            SceneNode* first_child = parent->first_child;
            if (first_child == NULL) {
                parent->first_child = child;
            } else {
                for (SceneNode* node = first_child->next; node != NULL; node = node->next) {
                    first_child = node;
                }
                first_child->next = child;
                child->previous = first_child;
            }
        } else {
            if (m_root != NULL) {
                return false;
            }
            m_root = child;
        }
    } else {
        return false;
    }

    return true;
}

